(4, 'EVABOT BETA GOES LIVE !!!', '<p><strong>Great news,</strong>&nbsp;the EVOAI automatic trading algorithm (EVABOT) has gone live for the first phase of beta testing. Congratulations to all of our EVOAI community who were selected for participation. Please understand that this is the testing phase, the site is not perfect but all site fixes, system upgrades will be resolved accordingly.&nbsp;</p>', 'Customers Announcement', '2018-12-10', '2019-03-31', 1, '2018-12-10 03:42:47', '2018-12-10 03:42:47'),
(6, 'EVABOT BETA PHASE 2 IS LIVE', '<p>HAPPY NEW YEAR TO ALL EVOAI INVESTORS !! EVABOT BETA PHASE 2 IS LIVE ! Congratulations to all the participants from the EVOAI community that were selected.&nbsp;&nbsp;</p>', 'Customers Announcement', '2019-01-13', '2019-02-02', 1, '2019-01-13 02:44:43', '2019-01-13 02:44:43'),
(5, 'EVABOT BETA GOES LIVE !!!', '<p><strong>Great news,</strong> the EVOAI automatic trading algorithm (EVABOT) has gone live for the first phase of beta testing. Congratulations to all of our EVOAI community who were selected for participation. Please understand that this is the testing phase, the site is not perfect but all site fixes, system upgrades will be resolved accordingly.&nbsp;</p>', 'What`s new', '2018-12-10', '2019-07-31', 1, '2018-12-10 03:43:57', '2018-12-10 03:43:57');
